import React, { useState, useEffect } from 'react';
import { Box, Typography, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Divider } from '@mui/material';
import { subscribeToVendedoras } from '../services/vendedorasService';

function formatDate(date) {
  if (!date) return '';
  return new Date(date).toLocaleString('pt-BR', {
    day: '2-digit', month: '2-digit', year: '2-digit',
    hour: '2-digit', minute: '2-digit', second: '2-digit'
  });
}

const Dashboard = () => {
  const [salesData, setSalesData] = useState([]);
  const [lastUpdate, setLastUpdate] = useState(null);

  useEffect(() => {
    const unsubscribe = subscribeToVendedoras((vendedoras) => {
      setSalesData(vendedoras);
      setLastUpdate(Date.now());
    });
    return () => unsubscribe();
  }, []);

  const total = salesData.reduce((acc, v) => acc + Number(v.valor), 0);
  const totalQtd = salesData.reduce((acc, v) => acc + (Number(v.qtd) || 0), 0);

  return (
    <Box sx={{
      minHeight: '100vh',
      minWidth: '100vw',
      bgcolor: '#181c24',
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      p: 0,
      m: 0,
      overflow: 'hidden',
    }}>
      <Box sx={{ mb: 4 }}>
        <img src="/logo.png" alt="Logo" style={{ maxWidth: 260, display: 'block', margin: '0 auto' }} />
      </Box>
      <Typography variant="h2" sx={{ color: '#fff', fontWeight: 900, mb: 1, letterSpacing: 2, textShadow: '2px 2px 8px #000' }} align="center">
        Produção por Plataforma
      </Typography>
      <Typography variant="h5" sx={{ color: '#aaa', mb: 5, textShadow: '1px 1px 4px #000' }} align="center">
        Última Atualização: {formatDate(lastUpdate)}
      </Typography>
      <TableContainer component={Paper} sx={{
        minWidth: 900,
        maxWidth: 1200,
        background: '#232a36',
        borderRadius: 3,
        boxShadow: '0 8px 32px 0 rgba(0,0,0,0.25)',
        overflow: 'hidden',
      }}>
        <Table>
          <TableHead>
            <TableRow sx={{ height: 70 }}>
              <TableCell sx={{ color: '#fff', fontWeight: 900, fontSize: 28, background: '#232a36', borderBottom: '3px solid #444', letterSpacing: 1, textShadow: '1px 1px 4px #000' }}>PLATAFORMA</TableCell>
              <TableCell align="right" sx={{ color: '#fff', fontWeight: 900, fontSize: 28, background: '#232a36', borderBottom: '3px solid #444', letterSpacing: 1, textShadow: '1px 1px 4px #000' }}>VLR CONTRATO</TableCell>
              <TableCell align="right" sx={{ color: '#fff', fontWeight: 900, fontSize: 28, background: '#232a36', borderBottom: '3px solid #444', letterSpacing: 1, textShadow: '1px 1px 4px #000' }}>QTD. AP's</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {salesData.map((vendedora) => (
              <TableRow key={vendedora.id} sx={{ height: 60 }}>
                <TableCell sx={{ color: '#fff', fontSize: 26, fontWeight: 700, letterSpacing: 1, textShadow: '1px 1px 4px #000' }}>{vendedora.nome}</TableCell>
                <TableCell align="right" sx={{ color: '#ffd700', fontSize: 28, fontWeight: 900, textShadow: '1px 1px 4px #000' }}>
                  R$ {Number(vendedora.valor).toLocaleString('pt-BR')}
                </TableCell>
                <TableCell align="right" sx={{ color: '#fff', fontSize: 26, fontWeight: 700, textShadow: '1px 1px 4px #000' }}>
                  {vendedora.qtd || '-'}
                </TableCell>
              </TableRow>
            ))}
            <TableRow>
              <TableCell colSpan={3} sx={{ p: 0 }}><Divider sx={{ bgcolor: '#444' }} /></TableCell>
            </TableRow>
            <TableRow sx={{ height: 70 }}>
              <TableCell sx={{ color: '#fff', fontWeight: 900, fontSize: 28, background: '#232a36', letterSpacing: 1, textShadow: '1px 1px 4px #000' }}>Total</TableCell>
              <TableCell align="right" sx={{ color: '#ffd700', fontWeight: 900, fontSize: 32, background: '#232a36', textShadow: '2px 2px 8px #000' }}>R$ {total.toLocaleString('pt-BR')}</TableCell>
              <TableCell align="right" sx={{ color: '#fff', fontWeight: 900, fontSize: 28, background: '#232a36', textShadow: '1px 1px 4px #000' }}>
                {totalQtd}
              </TableCell>
            </TableRow>
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};

export default Dashboard;
